DROP TABLE IF EXISTS `company`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8mb4 */;
CREATE TABLE `company` (
  `id_company` bigint(20) NOT NULL AUTO_INCREMENT,
  `name_company` varchar(255) NOT NULL,
  `location` text NOT NULL,
  `description` text DEFAULT NULL,
  `email` varchar(255) NOT NULL,
  `phone_number` varchar(20) NOT NULL,
  `company_url` varchar(2048) DEFAULT NULL COMMENT 'Website URL of the company',
  `company_picture` longblob DEFAULT NULL COMMENT 'Binary data of the company logo/picture',
  `company_picture_mime` varchar(50) DEFAULT NULL COMMENT 'MIME type of the company picture (e.g., image/png)',
  `number_of_students` int(11) DEFAULT 0,
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `created_by_pilote_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id_company`),
  UNIQUE KEY `email` (`email`),
